// src/components/TechStack.js
import React from "react";
import { motion } from "framer-motion";

const stack = [
  { name: "Python", logo: "https://cdn.jsdelivr.net/gh/devicons/devicon/icons/python/python-original.svg" },
  { name: "TensorFlow", logo: "https://cdn.jsdelivr.net/gh/devicons/devicon/icons/tensorflow/tensorflow-original.svg" },
  { name: "PyTorch", logo: "https://cdn.jsdelivr.net/gh/devicons/devicon/icons/pytorch/pytorch-original.svg" },
  { name: "React", logo: "https://cdn.jsdelivr.net/gh/devicons/devicon/icons/react/react-original.svg" },
  { name: "Docker", logo: "https://cdn.jsdelivr.net/gh/devicons/devicon/icons/docker/docker-original.svg" },
  { name: "Git", logo: "https://cdn.jsdelivr.net/gh/devicons/devicon/icons/git/git-original.svg" },
  { name: "SQL", logo: "https://cdn.jsdelivr.net/gh/devicons/devicon/icons/mysql/mysql-original.svg" },
  { name: "Streamlit", logo: "https://streamlit.io/images/brand/streamlit-logo-primary-colormark-darktext.png" },
  { name: "Power BI", logo: "https://upload.wikimedia.org/wikipedia/commons/c/cf/New_Power_BI_Logo.svg" }
];

export default function TechStack() {
  return (
    <section className="container mx-auto px-6 py-20 bg-gray-900" id="tech">
      <motion.h2
        initial={{ opacity: 0 }}
        whileInView={{ opacity: 1 }}
        transition={{ duration: 1 }}
        className="text-4xl font-bold text-blue-300 mb-12 text-center"
      >
        My Tech Stack
      </motion.h2>
      <div className="flex flex-wrap justify-center items-center gap-8">
        {stack.map((tech, i) => (
          <motion.div
            key={i}
            whileHover={{ scale: 1.1 }}
            className="w-24 h-24 bg-gray-800 rounded-2xl shadow-xl flex items-center justify-center p-4"
          >
            <img src={tech.logo} alt={tech.name} title={tech.name} className="h-12" />
          </motion.div>
        ))}
      </div>
    </section>
  );
}
